        private void DistanceBearing(List<Points> TraversePath)
        {
            GC.Collect();

            rtbx.Text = "";

            sb = new StringBuilder();
            distBear = new StringBuilder();

            //Insert Header
            sb.Append(@"{\rtf1\deff0{\fonttbl{\f0 Calibri;}{\f1 Arial;}{\f2 Times New Roman;}}{\colortbl ;\red0\green0\blue255 ;\red0\green0\blue0 ;}{\*\defchp \fs22}{\stylesheet {\ql\fs22 Normal;}{\*\cs1\fs22 Default Paragraph Font;}{\*\cs2\sbasedon1\fs22 Line Number;}{\*\cs3\ul\fs22\cf1 Hyperlink;}{\*\ts4\tsrowd\fs22\ql\tscellpaddfl3\tscellpaddl108\tscellpaddfb3\tscellpaddfr3\tscellpaddr108\tscellpaddft3\tsvertalt\cltxlrtb Normal Table;}{\*\ts5\tsrowd\sbasedon4\fs22\ql\trbrdrt\brdrs\brdrw10\trbrdrl\brdrs\brdrw10\trbrdrb\brdrs\brdrw10\trbrdrr\brdrs\brdrw10\trbrdrh\brdrs\brdrw10\trbrdrv\brdrs\brdrw10\tscellpaddfl3\tscellpaddl108\tscellpaddfr3\tscellpaddr108\tsvertalt\cltxlrtb Table Simple 1;}}{\*\listoverridetable}{\info{\creatim\yr2018\mo4\dy7\hr21\min29}{\version1}}\nouicompat\splytwnine\htmautsp\sectd\pard\plain\qc{\b\ul\f1\fs32\cf0 BEARING AND DISTANCE FROM COORDINATES}\fs22\par\pard\plain\ql\fs22\par");

            var n = TraversePath.Count;

            //Insert Point Distance and Bearing
            for (int i = 1; i < n - 1; i++)
            {                
                InsertDistBear(TraversePath[i], TraversePath[(i + 1 > n - 2) ? 1 : i + 1]);
            }
            
            //Insert Connectiion pillar
            sb.Append(@"\pard\plain\qc{\b\ul\f1\fs22\cf0 CONNECTING PILLARS}\fs16\par\pard\plain\ql\fs22\par");
            InsertDistBear(TraversePath[0], TraversePath[1]); //-
            InsertDistBear(TraversePath[n - 2], TraversePath[n - 1]); // - 

            disBEAR = distBear.ToString().Split('\n');

            //End Report
            sb.Append(@"}");
            rtbx.RtfText = sb.ToString();

            GNSS_Functions.DistanceBearing = rtbx.RtfText;

            GC.Collect();
        }

        StringBuilder distBear = new StringBuilder();
        private void InsertDistBear(Points A, Points B)
        {
            string SiteA = A.SiteID;
            string SiteB = B.SiteID;
            var Ea = double.Parse(A.Eastings);
            var Na = double.Parse(A.Northings);
            var Eb = double.Parse(B.Eastings);
            var Nb = double.Parse(B.Northings);
            double dy = Eb - Ea;
            double dx = Nb - Na;
            string Xa = A.Eastings;
            string Ya = A.Northings;
            string Xb = B.Eastings;
            string Yb = B.Northings;
            string dX = dx.ToString("#.00");
            string dY = dy.ToString("#.00");
            string Dist = Math.Sqrt(Math.Pow(dx, 2) + Math.Pow(dy, 2)).ToString("#.00");
            double bear = GNSS_Functions.Degree(Math.Atan(double.Parse(dY)/ double.Parse(dX))); //GNSS_Functions.Degree(Math.Atan(dy/dx));

            if (dx > 0 && dy < 0)
            {
                bear += 360;
            }
            else if (dx < 0 && dy < 0)
            {
                bear += 180;
            }
            else if (dx < 0 && dy > 0)
            {
                bear += 180;
            }
            
            var dms = GNSS_Functions.DegDec2DMS(bear);

            for (int i = 0; i < 3; i++)
            {
                if (Math.Round(dms[2]) >= 59.5)
                {
                    dms[2] = 0;
                    dms[1] += 1;
                }
                if (Math.Round(dms[1]) >= 59.5)
                {
                    dms[1] = 0;
                    dms[0] += 1;
                }
            }

            string deg = dms[0].ToString("000");
            string min = dms[1].ToString("00");
            string sec = dms[2].ToString("00");

            distBear.AppendLine(deg + " " + min + " " + sec + " " + Dist);

